import React from 'react';

const getDinnerState = () => {
    return [
        {
            dinnerName: 'French Dinner',
            orderable: 'true',
            details: [
                {
                    menuName: 'coffee',
                    size: 1,
                    measure: 'cup',
                },
                {
                    menuName: 'steak',
                    size: 1,
                    measure: '',
                },
            ]
        }
    ]
};

const DinnerSelectForm = () => {
    return (
        <div>dinner</div>
    );
}

export default DinnerSelectForm;
